import { Card } from 'antd'
import styled from 'styled-components'

const StyledCard = styled(Card)`
  width: 100%;
  margin-bottom: 20px;

  .ant-divider.ant-divider-horizontal {
    margin-top: 0;
  }
`

export default StyledCard
